import React from 'react';
import './style.css';
import Sidebar from '../../components/Sidebar';
import Card from '../../components/UI/Card';


const Home = props=> {
    const galleryHeight=450;
    return(
        <div>
            <Card>
                <div className="galleryPost">
                <section>
                    mostpopular post
                </section>
                <section>
                    less popular post
                </section>
                </div>
                
            </Card>
        </div>
    );
}

export default Home;
